import React from 'react'
import { StyleSheet, View, Text, TextInput } from 'react-native'

const TextScreen = () => {
  return (
    <View>
        <TextInput 
            style={styles.input} 
            autoCapitalize={false}
            />
    </View>
  )
}

const styles = StyleSheet.create({
    input: {
        margin: 15,
        borderColor: 'black',
        borderWidth: 1
    }
});

export default TextScreen
